import React from "react";
import SearchResults from "../SearchResults/index";
import API from "../../utils/API"

function SearchBooks() {
    API.getTitle("Harry Potter").then(function (obj) {
        console.log(obj.data.items[0].volumeInfo.title);
        console.log(obj.data.items[0].volumeInfo.authors);
        console.log(obj.data.items[0].volumeInfo.imageLinks.smallThumbnail);
    })
    return (
        <div>
            <form className="form-group d-flex mx-5 mt-2 justify-content-center">

                <input type="text"
                    // value={this.state.search}
                    className="form-control col-6"
                    placeholder="Search" />
            </form>
            <h4 className="col-9 mx-auto mt-3">Results:</h4>
            <SearchResults />
        </div>

    );
}

export default SearchBooks;

